WITH date_cte AS (SELECT d_date_sk, d_year FROM date_dim WHERE d_year = 1999), item_cte AS (SELECT i_item_sk, i_item_id FROM item WHERE i_category = 'Music'), customer_demo_cte AS (SELECT cd_demo_sk, cd_gender, cd_education_status FROM customer_demographics WHERE cd_gender = 'F' AND cd_education_status = '4 yr Degree'), customer_cte AS (SELECT c_customer_sk, c_birth_month, c_birth_year, c_current_addr_sk FROM customer WHERE c_birth_month = 12), address_cte AS (SELECT ca_address_sk, ca_country, ca_state, ca_county FROM customer_address WHERE ca_state IN ('AR', 'IN', 'VA')), prefactored_fact AS (SELECT cs_sold_date_sk, cs_item_sk, cs_bill_cdemo_sk, cs_bill_customer_sk, cs_quantity, cs_list_price, cs_coupon_amt, cs_sales_price, cs_net_profit FROM catalog_sales WHERE cs_wholesale_cost BETWEEN 5 AND 10) SELECT i_item_id, ca_country, ca_state, ca_county, AVG(CAST(cs_quantity AS DECIMAL(12,2))) AS agg1, AVG(CAST(cs_list_price AS DECIMAL(12,2))) AS agg2, AVG(CAST(cs_coupon_amt AS DECIMAL(12,2))) AS agg3, AVG(CAST(cs_sales_price AS DECIMAL(12,2))) AS agg4, AVG(CAST(cs_net_profit AS DECIMAL(12,2))) AS agg5, AVG(CAST(c_birth_year AS DECIMAL(12,2))) AS agg6 FROM prefactored_fact INNER JOIN date_cte ON cs_sold_date_sk = d_date_sk INNER JOIN item_cte ON cs_item_sk = i_item_sk INNER JOIN customer_demo_cte ON cs_bill_cdemo_sk = cd_demo_sk INNER JOIN customer_cte ON cs_bill_customer_sk = c_customer_sk INNER JOIN address_cte ON c_current_addr_sk = ca_address_sk GROUP BY ROLLUP (i_item_id, ca_country, ca_state, ca_county) ORDER BY ca_country, ca_state, ca_county, i_item_id LIMIT 100